import React from 'react';

const tech = ['MERN (MongoDB, Express, React, Node.js)', 'Python', 'Java', 'C', 'HTML', 'CSS', 'SQL', 'MongoDB'];
const soft = ['Teamwork', 'Adaptability', 'Decision Making', 'Critical Thinking', 'Empathy'];

export default function Skills() {
  return (
    <section className="my-8">
      <h2 className="text-2xl font-semibold mb-3">Skills</h2>
      <div className="grid md:grid-cols-2 gap-4">
        <div className="card">
          <h3 className="font-semibold mb-2">Technical</h3>
          <ul className="list-disc pl-5">
            {tech.map(t => <li key={t}>{t}</li>)}
          </ul>
        </div>
        <div className="card">
          <h3 className="font-semibold mb-2">Soft Skills</h3>
          <ul className="list-disc pl-5">
            {soft.map(s => <li key={s}>{s}</li>)}
          </ul>
        </div>
      </div>
    </section>
  );
}
